import React from 'react';
import {} from '';

import ShopPreview from '../../components/shop-preview/ShopPreview';

export const Shop = () => {
  const { shopItems } = this.state;
  return (
    <div className='shop'>
      {shopItems.map(({ id, ...otherShopItemsProps }) => (
        <ShopPreview key={id} {...otherShopItemsProps} />
      ))}
    </div>
  );
};

export default Shop;
